import { AppBar, Tabs, Toolbar, Typography, } from '@mui/material';

// const Header = styled(AppBar)`
// background: #111111
// `;

const NavBar = () => {
    return (
        <AppBar component={"NavBar"} sx={{bgcolor: "black"}}>
            <Toolbar>
                <Tabs>Code for Narendra </Tabs>
                <Tabs>All Users</Tabs>
                <Tabs>Add User</Tabs>
            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
